import React from 'react';
import logo from './logo.svg';
import './App.css';
import Greet from './components/Greet'
import Welcome from './components/Welcome'
import Hello from './components/Hello'

function App() {
  return (
    <div className="App">
      <Greet name="Bobby" wifeName="Hootie">
        <p>Yobusaeyo?</p>
      </Greet>
      <Greet name="Good Job" wifeName="Hootie">
        <button>LMAOOOO Touch me :D</button>
      </Greet>
      <Greet name="Hang in there" wifeName="Hootie"/>
    </div>
  );
}

export default App;
